import React from 'react';
import { StyleSheet, SafeAreaView, ScrollView, Image, FlatList } from 'react-native';

const Display = ({route}) => {

    // const pages = route.params
    const pages = [
        "https://i.ibb.co/wpcHGc3/001.jpg",
        "https://i.ibb.co/kQ8k7Ph/002.jpg",
        "https://i.ibb.co/vd3T0Jd/003.jpg",
        "https://i.ibb.co/4KcgqWn/004.jpg",
        "https://i.ibb.co/gPSK3zM/005.jpg",
        "https://i.ibb.co/1XCZPkV/006.jpg",
        "https://i.ibb.co/DwV66QJ/007.jpg",
        "https://i.ibb.co/5nh6vV3/008.jpg",
        "https://i.ibb.co/JQJ5rb0/009.jpg",
        "https://i.ibb.co/VBxtJck/010.jpg",
        "https://i.ibb.co/yYpPYdq/011.jpg",
        "https://i.ibb.co/gMqCcz2/012.jpg",
        "https://i.ibb.co/m4R2t3D/013.jpg",
        "https://i.ibb.co/VDRDpx0/014.jpg",
        "https://i.ibb.co/qmqYmWY/015.jpg",
        "https://i.ibb.co/Gdsx6mb/016.jpg"
      ]

    const renderItem = ({page}) => (
        <View style={styles.container}>
            <Image  source={{uri:page}} style={styles.page}/>
        </View>
    );
    return (
        <SafeAreaView style={styles.container}>
            <FlatList
                data={pages}
                renderItem={renderItem}
                keyExtractor={item=>item}
                // {pages.map(page => (
                //     <Image  source={{uri:page}} style={styles.page}/>
                // ))}
            />
        </SafeAreaView>
    );
}

const styles = StyleSheet.create({
    container: {
        flex:1,
        backgroundColor: 'black',
    },
    page:{
        flex:1,
        resizeMode: 'contain',
    }
});

export default Display;
